private void init() {
  value = -1;
  for (int n = 0; n < TABLE_LENGTH; ++n) {
    long crc = n;
    for (int i = 0; i < 8; ++i) {
      if ((crc & 1) == 1) {
        crc = (crc >>> 1) ^ POLY;
      } else {
        crc >>>= 1;
      }
    }
    TABLE[n] = crc;
  }
}
